import React, { Component } from 'react'
import Navbar from './components/Navbar'
import News  from './components/News'
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import LoadingBar from 'react-top-loading-bar';


state={
  progress:0
}

setProgress=(progress)=>{
  this.setState({progress: progress})
}

export default class App extends Component {

  render() {
    return (
      <div>
        <Router>
        <LoadingBar
        color='#f11946'
        progress={this.state.progress}
        />
        <Navbar/>
          <Routes>
            <Route exact path="/" element={<News setProgrees={this.setProgress} key="general" country="in" category="general"/>} />
            <Route exact path="/business" element={<News setProgrees={this.setProgress} key="business" country="in" category="business"/>} />
            <Route exact path="/entertainment" element={<News setProgrees={this.setProgress} key="entertainment" country="in" category="entertainment"/>} />
            <Route exact path="/health" element={<News setProgrees={this.setProgress} key="health" country="in" category="health"/>} />
            <Route exact path="/science" element={<News setProgrees={this.setProgress} key="science" country="in" category="science"/>} />
            <Route exact path="/sports" element={<News setProgrees={this.setProgress} key="sports" country="in" category="sports"/>} />
            <Route exact path="/technology" element={<News setProgrees={this.setProgress} key="technology" country="in" category="technology"/>} />
          </Routes>
        </Router>
      </div>
    )
  }
}
